GROUP.EXPRESSION:
REVLD_ORIG_RBEL_CLNT_CD = '1'
 AND
REVLD_ORIG_NRE_CLM_CD = '0'
 AND 
RBEL_CLNT_CD = '1'
 AND
NRE_CLM_CD = '0'

// Rebate Elgible code; 0=Non-Eligible, 1=Eligible
// Claim codes; 0=Good, 1-Bad-Fixiable, 2=Bad Hard.

// Only Rebate Eligible-Good claims are put into RCIT_CLM_INV_ELIG [CIE].

// If a claim was Rebate Eligible-Good and after ReValidation STILL is Rebate-Eligible good, the CIE row is updated.

(REVLD_ORIG_RBEL_CLNT_CD != '1'
 OR
REVLD_ORIG_NRE_CLM_CD != '0')
 AND 
RBEL_CLNT_CD = '1'
 AND
NRE_CLM_CD = '0'

// Rebate Elgible code; 0=Non-Eligible, 1=Eligible
// Claim codes; 0=Good, 1-Bad-Fixiable, 2=Bad Hard.

// Only Rebate Eligible-Good claims are put into RCIT_CLM_INV_ELIG [CIE].

// If a claim was NOT eligible to be in CIE, but after ReValidation becomes Eligible-Good, the claim gets added to CIE.

REVLD_ORIG_RBEL_CLNT_CD = '1'
 AND 
REVLD_ORIG_NRE_CLM_CD = '0'
 AND 
 ( RBEL_CLNT_CD != '1'
    OR
  NRE_CLM_CD != '0')

// Rebate Elgible code; 0=Non-Eligible, 1=Eligible
// Claim codes; 0=Good, 1-Bad-Fixiable, 2=Bad Hard.

// Only Rebate Eligible-Good claims are put into RCIT_CLM_INV_ELIG [CIE].

// If a claim was Rebate Eligible-Good to start, but becomes either Non-Eligible or Fixable or Bad, then the claim needs to be removed from CIE.
